var cx = 33*12;
var cy = 25*12;
var r = 23*12;
var ang = 7/r;
for(;r&gt;0;r-=7,ang=7/r)
	for(var a = 0; a &lt; 2*Math.PI; a+=ang)
		document.write(&quot;0^&quot;+Math.round(cx+r*Math.cos(a))+&quot;,&quot;+Math.round(cy+r*Math.sin(a))+&quot;!&quot;);

I think we all do, but nobody cares. That's just the impression I get.

You might have noticed I like a certain amount of chaos in my levels. I like to give the impression that what you're playing in could be a real place as well as a carefully designed level. As such some elements will have an illogical quality asif to describe the semi-chaotic way that real places are formed. For example I was one of the first to popularize the unreachable exit and the impassible tunnel (which is half-a-tile wide in places).

Not only that but I'm in love with the ridiculous. Ungettable gold is about as good as it gets.

